        example: 8b3b58fc-a422-4f56-869a-a4d20f1c822e
        in: query
        name: ID
        required: false
        schema: {type: string}
      - description: Exception Item ID
        example: external-IPs
        in: query
        name: Exception Item ID
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp13'}
          description: Successful request
      summary: Elastic Kibana Delete Exception Item
  tmp14:
    post:
      description: Export SIEM detection rules
      parameters:
      - description: Exclude Export Details
        example: 'false'
        in: query
        name: Exclude Export Details
        required: false
        schema: {type: boolean}
      - description: Filename of the exported attachment
        example: export.json
        in: query
        name: File Name
        required: false
        schema: {type: string}
      - description: Array of rule_id values
        example: '''35df0dd8-092d-4a83-88c1-5151a804f31b'',''5151a804f31b-092d-4a83-88c1-88c14a83'
        in: query
        name: Rule ID
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp14'}
          description: Successful request
      summary: Elastic Kibana Export Detection Rules
  tmp15:
    post:
      description: Find or search for cases
      parameters:
      - description: Filters the returned cases by state, which can be open or closed
        example: open
        in: query
        name: Status
        required: false
        schema: {type: string}
      - description: The number of rules to return per page
        example: '20'
        in: body
        name: Per Page
        required: false
        schema: {type: string}
      - description: Filters the returned cases by tags
        example: '''phishing'',''macro'''
        in: query
        name: Tags
        required: false
        schema: {type: string}
      - description: Determines which field is used to sort the results, createdAt
          or updatedAt
        example: createdAt
        in: query
        name: Sort Field
        required: false
        schema: {type: string}
      - description: Determines the sort order which can be desc or asc
        example: desc
        in: query
        name: Sort Order
        required: false
        schema: {type: string}
      - description: "Filters the returned cases by the reporter\u2019s username"
        example: first.last
        in: query
        name: Reporters
        required: false
        schema: {type: string}
      - description: The page number to return
        example: '1'
        in: body
        name: Page
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp15'}
          description: Successful request
      summary: Elastic Kibana Find Cases
  tmp16:
    post:
      description: Retrieve detection rules from SIEM
      parameters:
      - description: Filter by a given name value
        example: windows
        in: query
        name: Name Filter
        required: false
        schema: {type: string}
      - description: Filter by rule tag
        example: windows
        in: query
        name: Tag Filter
        required: false
        schema: {type: string}
      - description: Filter by a rules configured interval
        example: 5min
        in: query
        name: Interval Filter
        required: false
        schema: {type: string}
      - description: Filter by whether a rule is enabled or not
        example: 'true'
        in: query
        name: Enabled Filter
        required: false
        schema: {type: string}
      - description: Filter by the creator of a rule
        example: Swimlane User
        in: query
        name: Created By Filter
        required: false
        schema: {type: string}
      - description: Determines the sort order, which can be desc or asc.
        example: asc
        in: query
        name: Sort Order
        required: false
        schema: {type: string}
      - description: The number of rules to return per page
        example: '20'
        in: body
        name: Per Page
        required: false
        schema: {type: string}
      - description: Determines which field is used to sort the rules
        example: name
        in: query
        name: Sort Field
        required: false
        schema: {type: string}
      - description: The page number to return
        example: '1'
        in: body
        name: Page
        required: false
        schema: {type: string}
      - description: Filter by who last updated a rule
        example: Swimlane User
        in: query
        name: Updated By Filter
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp16'}
          description: Successful request
      summary: Elastic Kibana Find Detection Rules
  tmp17:
    post:
      description: Returns a subset of exception containers
