        name: Namespace Type
        required: false
        schema: {type: string}
      - description: Filters the returned results according to the value of the specified
          field. Field names are name, type, created_by, updated_by
        example: name:*
        in: query
        name: Filter
        required: false
        schema: {type: string}
      - description: Determines the sort order, which can be desc or asc
        example: asc
        in: query
        name: Sort Order
        required: false
        schema: {type: string}
      - description: The number of containers to return per page
        example: '5'
        in: body
        name: Per Page
        required: false
